        <Route
          path="/"
          element={Main}
          loggedIn={loggedIn}
        />
        <Route path="/sign-up" element={
          <Register onRegister={handleRegister} />}
        />
        <Route path="/sign-in" element={
          <Login onLogin={handleLogin} />}
        />
      </Routes>
      <Main></Main>
